import Head from 'next/head';
import fetch from 'isomorphic-unfetch';

//images
import black1 from '../images/black1.jpg';

//styles
import '../styles/main.scss';

 const Main = props => {

    const onClick = () => {
        console.log(props._proto_.length)
    }

    return (
        <div className="main">
            <Head>
                <title>MonteCristo Eau De Perfume</title>
            </Head>
            <div className="firstSection">
                <div className="left">
                <img src={black1} alt="perfume"/>
                </div>
                <div className="right">
                    <h1>MONTECRISTO</h1>
                    <p className="first-section-paragraph">YOUR ONLY CHOICE</p>
                    <button onClick={onClick} className="btn-learn">LEARN MORE</button>
                </div>
            </div>
