                </div>
                <div className="right">
                    <img src="" alt="perfume2"/>
                </div>
            </div>
            <div className="thirdSection">
                <h3>PICK YOUR POISON</h3>
                <img src="" alt="perfumex"/>
                <img src="" alt="perfumey"/>
                <img src="" alt="perfumez"/>
                <button>MORE</button>
            </div>
            <div className="forthSection">
                <div className="left">
                    <h4>ARE YOU READY?</h4>
                    <p>GO AHEAD AND MAKE YOURSELF ALPHA MALE</p>
                    <button>SHOP NOW</button>
                </div>
                <div className="right">
                    <img src="" alt="another"/>
                </div>
            </div>
            <div className="fifthSection">
                <div className="left">
                    <img src="" alt="another"/>
                </div>
                <div className="right">
                    <h5>PARTNERSHIP</h5>
                    <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. </p>
                </div>
            </div>
            <div className="contactForm">
                <p>some contact form later on</p>
            </div>
        </div>
    );
}
    Main.getInitialProps = async function() {
        const res = await fetch('http://localhost:1337/homes');
        const data = await res.json();

        console.log(`Show data fetched. Count: ${data.length}`);

        return{
            props :data
        }
    };


export default Main;
